function BookingsPage() {
  const bookings = [
    {
      id: 1,
      hotelName: 'Luxury Hotel',
      checkIn: '2024-09-01',
      checkOut: '2024-09-07',
      guests: 2,
      price: '$1200',
      image: 'luxury-hotel.jpg',
    },
    {
      id: 2,
      hotelName: 'Beachside Resort',
      checkIn: '2024-10-15',
      checkOut: '2024-10-20',
      guests: 4,
      price: '$2000',
      image: 'beachside-resort.jpg',
    },
    {
      id: 3,
      hotelName: 'Mountain Retreat',
      checkIn: '2024-11-05',
      checkOut: '2024-11-10',
      guests: 3,
      price: '$1500',
      image: 'mountain-retreat.jpg',
    },
  ];

  return (
    <div className="bookings-page">
      <h1>Your Bookings</h1>
      <div className="bookings-list">
        {bookings.map((booking) => (
          <div className="booking-item" key={booking.id}>
            <img src={booking.image} alt={booking.hotelName} className="booking-image" />
            <div className="booking-details">
              <h2>{booking.hotelName}</h2>
              <p><strong>Check-In:</strong> {booking.checkIn}</p>
              <p><strong>Check-Out:</strong> {booking.checkOut}</p>
              <p><strong>Guests:</strong> {booking.guests}</p>
              <p><strong>Price:</strong> {booking.price}</p>
            </div>
            <button className="cancel-button">Cancel Booking</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default BookingsPage;
